import styled from 'styled-components'

export const XSmall = styled.div`
    margin-top: 10px;
`
export const Small = styled.div`
    margin-top: 20px;
`

export const Medium = styled.div`
    margin-top: 40px;
`

export const Large = styled.div`
    margin-top: 80px;
`

export const XLarge = styled.div`
    margin-top: 120px;
`
